import React from 'react';
import './header2.styles.css';

const Header2 = () => {
  return (
    <div className="header2">
      <h1 className="logo">Logo</h1>
      <input type="checkbox" className="nav-goggle"></input>
      <nav>
        <ul>
          <li>
            <a href="#">Home</a>
          </li>
          <li>
            <a href="#">About</a>
          </li>
          <li>
            <a href="#">Blog</a>
          </li>
          <li>
            <a href="#">Content</a>
          </li>
        </ul>
      </nav>
    </div>
  );
};
export default Header2;
